import React from "react";
import GenerateButton from "./GenerateBtn";
import UploadButton from "./UploadBtn";


const UploadPage = () => {
    return (
        <React.Fragment>
            <h1>Upload Page</h1>
            <div></div>
            <div>
            <GenerateButton></GenerateButton>    
            <UploadButton></UploadButton>
            </div>
        </React.Fragment>
        
    );
};

export default UploadPage;
